import Typography from '@mui/material/Typography';
import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Box from '@mui/material/Box';
import { Button, CardActionArea, CardActions } from '@mui/material';

export default function ProductDetailsPage({ match }) {
  const productId = match.params.id; // получаем идентификатор товара из URL

  // В этом компоненте вы можете выполнить запрос к серверу, используя полученный идентификатор товара,
  // чтобы получить дополнительные данные о товаре, если это необходимо.

  return (
    <div>
      <Typography variant="h4">Product Details</Typography>
      <Typography variant="body1">Product ID: {productId}</Typography>
     <Box>
     <Card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image="/static/images/cards/contemplative-reptile.jpg"
          alt="green iguana"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            Lizard
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Lizards are a widespread group of squamate reptiles, with over 6,000
            species, ranging across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
      </CardActions>
    </Card>
     </Box>
    </div>
  );
}
